import React from 'react';

import Counter from './counter/Counter';
import GetAllAccounts from './ApiAcount/GetAllAccounts';
import GetAccountByID from './ApiAcount/GetAccountById';

import './App.css';

function App() {

    var ID = document.getElementById('title').value;
    GetAccountByID(ID);

  return (
      <div>
          <Counter/>
          <input id='ID' value={ID} onChange={ID = document.getElementById('title').value}></input>
      </div>
  );
}

export default App;
